measurements.description:
Three flowers of exceptional dark color and two buds on one upright 65-cm arching inflorescence;
 sepals and petals lanceolate, acute, intense dark purple-violet, white proximally;

 lip tri-lobed, midlobe ovate, acute, recurved apically and marginally, white overlaid pink, midlobe overlaid dark velvety purple-violet
 distally, throat striped maroon, keels three, yellow, striped maroon dorsally;
 column white, stippled violet, anther cap white;
 substance firm; texture glossy.
